// given a string return a hash map...
func charCount(s string) []int {
  m := make([]int, 26)
  aInt := int("a"[0])

  for _,v := range s {
    m[int(v)-aInt] = m[int(v)-aInt]+1
  }

  return m
}

// bang out something simple....
func isAnagramMatch(s1 string, sRef []int) bool {
  //fmt.Println("iam", len(s1))
  sCur := charCount(s1)
  for i:=0 ; i<26 ; i++ {
    //fmt.Println(i, sCur[i], sRef[i])
    if sCur[i] != sRef[i] {
      return false
    }
  }
  return true
}

func findAnagrams(s string, p string) []int {
  //fmt.Println(">fa")
  if len(p) > len(s) {
    return nil
  }

  //pHash := anagramHash(p)
  result := make([]int, 0)
  pMap := charCount(p)

  start := time.Now()  
  for i,j := 0, len(p) ; j<=len(s) ; i,j = i+1, j+1 {
    //fmt.Println(i,j)

    if isAnagramMatch(s[i:j], pMap) {
      result = append(result, i)
    }
    
  }
  elapsed := time.Since(start)
  fmt.Println(elapsed)

  return result
}


